Verenigde Staten
Actie / Science-Fiction
116 minuten

geregisseerd door Jonathan Liebesman
met Aaron Eckhart, Michelle Rodriguez en Bridget Moynahan

Al jaren worden er over de hele wereld ufo's waargenomen en gedocumenteerd: Buenos Aires, Seoul, Frankrijk, Duitsland, China. Maar in 2011 worden die vage waarnemingen keiharde werkelijkheid wanneer de aarde wordt aangevallen door onbekende krachten. Terwijl overal ter wereld grote steden worden verwoest, houdt alleen Los Angeles nog stand in een strijd die nooit voor mogelijk werd gehouden. Een sergeant van de Marine (Aaron Eckhart) en zijn nieuwe peloton moeten een halt zien toe te roepen aan een vijand die alles overtreft waar ze ooit tegen hebben gestreden.



